import {Container, Heading} from "@chakra-ui/react";

function EndedMatches(){
    return(
        <Container alignItems='left' bg='pink' minW='100%' mt='60px'>
            <Heading bg='#030303' color='#7b7b7b' textAlign='center'>
                Ended Matches
            </Heading>
        </Container>
    )
}

export default EndedMatches
